<head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width">
    <title>Hazumi and the Pregnation Cafe</title>
    <style type="text/css">
        td.Ccell {
            width: 90px;
            height: 90px;
            text-align: center;
            vertical-align: middle;
        }
        
        .radio-toolbar {
            /*margin: 1px;*/
            display: fixed;
        }
        
        .radio-toolbar input[type="radio"] {
            opacity: 0;
            position: flex;
            width: 0;
        }
        
        .radio-toolbar label {
            display: inline-block;
            background-color: #ddd;
            padding: 5px 5px;
            font-family: sans-serif, Arial;
            font-size: 12px;
            border: 2px solid #444;
            border-radius: 4px;
        }
        
        .radio-toolbar label:hover {
            background-color: #dfd;
        }
        
        .radio-toolbar input[type="radio"]:focus+label {
            border: 2px dashed #444;
        }
        
        .radio-toolbar input[type="radio"]:checked+label {
            background-color: #bfb;
            border-color: #4c4;
        }
    </style>

    <script type="text/javascript">
        var order = ["‚òï", "üç¶", "üç™", "ü•§", "ü•™", "‚òï‚òï"]
        var radios = [];

        function createRadioElement(rID, name, value, checked) {

            var radioItem1 = document.createElement("input");
            radioItem1.type = "radio";
            radioItem1.id = rID;
            radioItem1.name = name;
            radioItem1.value = value;
            radioItem1.style.display = "none";

            var objTextNode1 = document.createTextNode(value);

            var objLabel = document.createElement("label");
            objLabel.htmlFor = radioItem1.id;
            objLabel.appendChild(objTextNode1);

            return [radioItem1, objLabel];
        }

        function createRadioList(rID, rname) {

            var objDiv = document.createElement('div');
            objDiv.className = "radio-toolbar";

            var table = document.createElement('table');

            for (var i = 0; i < order.length; i = i + 2) {

                var tr = document.createElement('tr');

                var td1 = document.createElement('td');
                var radioItem = createRadioElement(rID + rname + order[i], rname, order[i], false);
                td1.appendChild(radioItem[0]);
                td1.appendChild(radioItem[1]);

                if (i + 1 < order.length) {
                    var td2 = document.createElement('td');
                    var radioItem = createRadioElement(rID + rname + order[i + 1], rname, order[i + 1], false);
                    td2.appendChild(radioItem[0]);
                    td2.appendChild(radioItem[1]);

                    tr.appendChild(td1);
                    tr.appendChild(td2);
                } else {
                    tr.appendChild(td1);
                }
                table.appendChild(tr);
            }
            objDiv.appendChild(table);

            document.write(objDiv.outerHTML);
            return objDiv;
        }

        function updateCounter() {
            var temp = [0, 0, 0, 0, 0, 0]
            radios.forEach(function(element) {
                if (element.checked) {
                    switch (element.value) {
                        case "‚òï":
                            temp[0] += 1
                            break;
                        case "üç¶":
                            temp[1] += 1
                            break;
                        case "üç™":
                            temp[2] += 1
                            break;
                        case "ü•§":
                            temp[3] += 1
                            break;
                        case "ü•™":
                            temp[4] += 1
                            break;
                        case "‚òï‚òï":
                            temp[5] += 1
                            break;
                    }
                }
            });

            document.getElementById("cof").innerHTML = temp[0];
            document.getElementById("par").innerHTML = temp[1];
            document.getElementById("mac").innerHTML = temp[2];
            document.getElementById("mel").innerHTML = temp[3];
            document.getElementById("san").innerHTML = temp[4];
            document.getElementById("tea").innerHTML = temp[5];

        }

        document.addEventListener('DOMContentLoaded', function() {

            var inputs = document.body.getElementsByTagName("*");
            //Loop and find only the Radios
            for (var i = 0; i < inputs.length; ++i) {
                if (inputs[i].type == 'radio') {
                    radios.push(inputs[i]);
                }
            }

            //var found = 1;
            for (var i = 0; i < radios.length; i++) {
                radios[i].addEventListener("change", function() {
                    updateCounter();
                });
            }
        }, false);

        function resetradio() {
            radios.forEach(function(element) {
                if (element.checked) {
                    element.checked = false;
                }
            });
            updateCounter();
        }
    </script>
